const to_bool = (param) => {
    switch (param) {
        case 0: return false; break;
        case 1: return true; break;
        case "true": return true; break;
        case "false": return false; break;
        case true: return true; break;
        case false: return false; break;
    }
}

const Prod = {
    to_bool
}

export default Prod
